webpackJsonp([0xe6cd0db60d2c],{5837:function(e,t){e.exports={data:{post:{html:'<p>Three years ago a bunch of foolish early-adopters became online beta testers for EditThisPage.com, a strange new service where one could set up and edit a website using only a browser. That was the <a href="http://shanson.editthispage.com/1999/12/05">beginning</a> of PapaScott, as well as a bunch of other weblogs that are still around. An old layout of the first really important PapaScott post is still <a href="http://mausnews.editthispage.com/1999/12/27">here</a>. So Happy Birthday to all of us.</p>',fields:{title:"3x365",date:"05 Dec 2002",url:"https://papascott.de/2002-12-05-3x365/"}}},pathContext:{slug:"/2002-12-05-3x365/",prev:{fields:{title:"PapaScott @ SourceForge",date:"04 Dec 2002",slug:"/2002-12-04-papascott-sourceforge/"}},next:{fields:{title:"Nikolaus comes on Dec 6",date:"07 Dec 2002",slug:"/2002-12-07-nikolaus-comes-on-dec-6/"}}}}}});
